Doom Patrol v5 #1-22 (2009-2011)
Publisher:  DC Comics
Publication Date:  December 2009 - July 2011

Cover by Matthew Clark
Written by J. M. DeMatteis, Keith Giffen
Pencils Matthew Clark, Kevin Maguire
